import React, { useEffect, useState } from 'react';
import { NavBar } from "./components/NavBar";
import './App.css';
import Footer from './components/Footer';
import { CircleLoader } from 'react-spinners';
import { PopupWidget } from "react-calendly";
import HomeScreen from './Screens/HomeScreen';
import logo from "./assets/img/logo2.jpg";
import { lineSpinner } from 'ldrs';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import PageNotFound from './components/PageNotFound';
import Leadership from './Screens/Signup/Leadership';

function App() {
  // Register lineSpinner when the component mounts
  useEffect(() => {
    lineSpinner.register();
  }, []);

  const [pageLoaded, setPageLoaded] = useState(false);

  useEffect(() => {
    setTimeout(() => setPageLoaded(true), 1000);
  }, []);

  if (!pageLoaded) {
    return (
      <div className='landing'>
      {!pageLoaded && (
        <div className='centered-loader'>
          <l-line-spinner
            size="150" // Adjust the size to match the logo
            stroke="8" // Adjust the stroke width
            speedMultiplier="1"
            color="black" // Adjust the color
          ></l-line-spinner>
        </div>
      )}

      {pageLoaded && (
        <BrowserRouter>
          <div className='App'>
            <NavBar />
            <Routes>
              <Route path='/' element={<HomeScreen />} />
              <Route path='/leadership' element={<Leadership />} />
              <Route path='*' element={<PageNotFound />} />
            </Routes>
            <Footer />
          </div>
        </BrowserRouter>
      )}
    </div>

    );
  } else {
    return (
      <BrowserRouter>
        <div className='App'>
          <NavBar />
          <Routes>
            <Route path='/' element={<HomeScreen />} />
            <Route path='/leadership' element={<Leadership />} />
            <Route path='*' element={<PageNotFound />} />
          </Routes>
          <Footer />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;




